import React from 'react';

const Contact = () => {
    return (
        <>
          <section className="Contact_Us">
                <div className="container-fluid">
                    <div className="row">
                        <div className="col-10 mx-auto">
                            <div className="row">
                                <div className="col-md-6 col-10 mx-auto">
                            
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
          </section>  
        </>
    );
};

export default Contact;
